		2758BB35179061C1007F6582 /* Run Script - Copy Renderer & Game Dynamic Libraries, Symlink Architecture */ = {
			isa = PBXShellScriptBuildPhase;
			buildActionMask = 2147483647;
			files = (
			);
			inputPaths = (
			);
			name = "Run Script - Copy Renderer & Game Dynamic Libraries, Symlink Architecture";
			outputPaths = (
			);
			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "#\n# copy the renderer & game dynamic libraries to their appropriate locations within the application bundle\n# symlink appropriate architecture names for universal (fat) binary support\n# TODO: missionpack support\n#\nBUILD=\"${BUILT_PRODUCTS_DIR}\"\nMACOS=\"${BUILT_PRODUCTS_DIR}/${EXECUTABLE_FOLDER_PATH}\"\nCGAME=\"cgame\"\nGAME=\"game\"\nQ3UI=\"q3_ui\"\nUI=\"ui\"\nBASEQ3=\"baseq3\"\nMISSIONPACK=\"missionpack\"\nRENDERER_OPENGL1=\"renderer_opengl1\"\nRENDERER_OPENGL2=\"renderer_opengl2\"\n\nfunction symlinkArch()\n{\n    EXT=\"dylib\"\n    SEP=\"${3}\"\n    SRCFILE=\"${1}\"\n    DSTFILE=\"${2}${SEP}\"\n    DSTPATH=\"${4}\"\n\n    if [ ! -e \"${DSTPATH}/${SRCFILE}.${EXT}\" ]; then\n        echo \"**** ERROR: missing ${SRCFILE}.${EXT} from ${MACOS}\"\n        exit 1\n    fi\n\n    if [ ! -d \"${DSTPATH}\" ]; then\n        echo \"**** ERROR: path not found ${DSTPATH}\"\n        exit 1\n    fi\n\n    pushd \"${DSTPATH}\" > /dev/null\n\n    IS32=`file \"${SRCFILE}.${EXT}\" | grep \"i386\" | awk '{print $NF}'`\n    IS64=`file \"${SRCFILE}.${EXT}\" | grep \"x86_64\" | awk '{print $NF}'`\n\n    if [ \"${IS32}\" == \"i386\" ]; then\n        if [ ! -L \"${DSTFILE}x86.${EXT}\" ]; then\n            ln -s \"${SRCFILE}.${EXT}\" \"${DSTFILE}x86.${EXT}\"\n        fi\n    elif [ -L \"${DSTFILE}x86.${EXT}\" ]; then\n        rm \"${DSTFILE}x86.${EXT}\"\n    fi\n\n    if [ \"${IS64}\" == \"x86_64\" ]; then\n        if [ ! -L \"${DSTFILE}x86_64.${EXT}\" ]; then\n            ln -s \"${SRCFILE}.${EXT}\" \"${DSTFILE}x86_64.${EXT}\"\n        fi\n    elif [ -L \"${DSTFILE}x86_64.${EXT}\" ]; then\n        rm \"${DSTFILE}x86_64.${EXT}\"\n    fi\n\n    popd > /dev/null\n}\n\nfunction checkBuildFile()\n{\n    if [ ! -e \"${BUILD}/${1}\" ]; then\n        echo \"**** ERROR: file not found '${BUILD}/${1}'\"\n        exit 1\n    fi\n}\n\nfunction checkMacOS()\n{\n    if [ ! -d \"${MACOS}\" ]; then\n        echo \"**** ERROR: missing executable folder path '${EXECUTABLE_FOLDER_PATH}'\"\n        exit 1\n    fi\n}\n\nfunction safeCopyBuildFileToFolder\n{\n    if [ ! -e \"${BUILD}/${1}\" ]; then\n        echo \"**** ERROR: file not found '${1}' in build folder '${BUILD}'\"\n        exit 1\n    fi\n\n    if [ ! -d \"${2}\" ]; then\n        echo \"**** ERROR: destination folder not found '${2}'\"\n        exit 1\n    fi\n\n    cp -pr \"${BUILD}/${1}\" \"${2}\"\n}\n\nfunction copyToMacOS()\n{\n    checkBuildFile \"${1}\"\n    checkMacOS\n\n    safeCopyBuildFileToFolder \"${1}\" \"${MACOS}\"\n}\n\nfunction copyToBaseQ3()\n{\n    checkBuildFile \"${1}\"\n    checkMacOS\n\n    if [ ! -d \"${MACOS}/${BASEQ3}\" ]; then\n        mkdir \"${MACOS}/${BASEQ3}\"\n    fi\n\n    safeCopyBuildFileToFolder \"${1}\" \"${MACOS}/${BASEQ3}\"\n}\n\nfunction copyToMissionPack()\n{\n    checkBuildFile \"${1}\"\n    checkMacOS\n\n    if [ ! -d \"${MACOS}/${MISSIONPACK}\" ]; then\n        mkdir \"${MACOS}/${MISSIONPACK}\"\n    fi\n\n    safeCopyBuildFileToFolder \"${1}\" \"${MACOS}/${MISSIONPACK}\"\n}\n\ncopyToMacOS \"${RENDERER_OPENGL1}.dylib\"\ncopyToMacOS \"${RENDERER_OPENGL2}.dylib\"\n\ncp \"${SRCROOT}/../../code/libs/macosx/libSDL2-2.0.0.dylib\" \"${MACOS}\"\n\nsymlinkArch \"${RENDERER_OPENGL1}\" \"${RENDERER_OPENGL1}\" \"_\" \"${MACOS}\"\nsymlinkArch \"${RENDERER_OPENGL2}\" \"${RENDERER_OPENGL2}\" \"_\" \"${MACOS}\" \n\ncopyToBaseQ3 \"${CGAME}.dylib\"\nsymlinkArch \"${CGAME}\" \"${CGAME}\" \"\" \"${MACOS}/${BASEQ3}\"\n\ncopyToBaseQ3 \"${GAME}.dylib\"\nsymlinkArch \"${GAME}\" \"${GAME}\" \"\" \"${MACOS}/${BASEQ3}\"\n\ncopyToBaseQ3 \"${Q3UI}.dylib\"\nsymlinkArch \"${Q3UI}\" \"${UI}\" \"\" \"${MACOS}/${BASEQ3}\"\n";
		};
/* End PBXShellScriptBuildPhase section */

